message: "19.05.2016 V období nejistoty před konáním britského referenda \r\no členství v EU bude pravděpodobně docházet ke znehodnocení libry, což povede ke ztrátám \r\nrelativních hodnot nemovitostí ve Velké Británii.\r\nBankovní sektor je negativně zasažen referendem o Brexitu, protože \r\nopuštění Británie Evropské unie by pro oba tábory znamenalo \r\nprodloužené období nízkých úrokových sazeb.\r\nKromě toho, často českým hráčům ani nezbude nic jiného než hrát online z počítače nebo \r\nmobilu, protože dostupnost kamenných heren je čím dál horší.\r\nObchod nabízí škálu značek (je jich skoro 500) - a to včetně \r\nvelmi známých a oblíbených, jako je Nike, Adidas, Guess, Salomon apod.\r\nKromě obuvi nabízí e-shop taky kabelky a další doplňky.\r\n imunita vzhledem k soudnímu a správnímu stíhání za skutky, kterých se dopustí při plnění služebních povinností (kromě \r\nškody při dopravních nehodách), celní výhody pro jejich osobní zavazadla, jaké jsou přiznány pracovníkům \r\ndiplomatických misí v daném státě, osvobození od přímých \r\ndaní a poplatků z peněžních částek, které jsou vypláceny zmocněncům a jejich zástupcům ze \r\nstrany státu, který je jmenoval, a osvobození od povinnosti k \r\nvojenské službě."
